import React from 'react';
import './Aboutus.css';


const Aboutus = () => {
    return(
        <section className="about_main">
            <div className="about__container">
                <div className="about__wrapper">
                    <p className="about__detail">About Info</p>
                </div>
            </div>
        </section>
    )
}

export default Aboutus;
